import React, {useState} from 'react'

interface Card{
    name: string;
}

const DeckBuilderPage = () => {
    const [CardsData, setCardsData] = useState<Card[]>();

    useEffect(() => {
        fetch('http://localhost:8000/DeckBuilder/GetAllCards')
          .then(res => res.json())
          .then((CardsData: Card[]) => {
            setCardsData(CardsData);
          })
          .catch(console.error);
      }, []);
      
    

    return (
        <div>
            DeckBuilderPage <br/>

            {CardsData.map(item => (
                <div>
                    <p>{item.name}</p>
                </div>
            ))}
        </div>
    )
}

export default DeckBuilderPage
